    [],nt"revision_timestamp": "2016-08-30T13:29:42.028830",nt"name": "forge-milford-triaxial-test-data-and-summary-from-egi-labs",nt"isopen":
    true,nt"url": null,nt"notes": "Six samples were evaluated in unconfined
    and triaxial compression, their data are included in separate excel spreadsheets,
    and summarized in the word document. Three samples were plugged along the axis of
    the core (presumed to be nominally vertical) and three samples were plugged perpendicular
    to the axis of the core. A designation of "V"indicates vertical or the long axis
    of the plugged sample is aligned with the axis of the core. Similarly, "H" indicates
    a sample that is nominally horizontal and cut orthogonal to the axis of the core.
    Stress-strain curves were made before and after the testing, and are included in
    the word doc.. The confining pressure for this test was 2800 psi. A series of tests
    are being carried out on to define a failure envelope, to provide representative
    hydraulic fracture design parameters and for future geomechanical assessments. The
    samples are from well 52-21, which reaches a maximum depth of 3581 ft +/- 2 ft into
    a gneiss complex. ",nt"license_title": "Creative Commons Attribution",nt"extras":
